            "productCode": "33175P7",
            "title": "Martha's Vineyard Private Tours",
            "description": "Tour will introduce the history of our 6 unique towns! \n Oak Bluffs, a Victorian seaside, built around the Methodist campgrounds with it's beautiful open air tabernacle and the Victorian gingerbread cottages once used for summer revival meetings,and the Flying Horse Carousel. Edgartown's stately white Greek Revival houses, The Old Whaling Church, the Edgartown Harbor Lighthouse, the historic Harborview Hotel. Vineyard Haven, the entry port to Martha’s Vineyard \n The scenic up-island country-side, historic farming towns of West Tisbury and Chilmark, a 15-min stop in Menemsha an Idyllic fishing The multi-colored clay cliffs of Aquinnah (Gay Head), with its impressive lighthouse where you will have an opportunity to get out take pictures and stretch your legs.\n island is so diverse, glimpses century old stone walls, The Atlantic shoreline, grazing livestock, rolling hills and historic homesteads. The we'll go over the bridge used in the filming of the movie Jaws!\n",
